import React, { useState } from 'react';

const Contact = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    subject: '',
    message: ''
  });

  const [isSubmitting, setIsSubmitting] = useState(false);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsSubmitting(true);
    
    // محاكاة إرسال النموذج
    setTimeout(() => {
      alert('شكراً لك! سأتواصل معك قريباً');
      setFormData({ name: '', email: '', subject: '', message: '' });
      setIsSubmitting(false);
    }, 1500);
  };

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  return (
    <section id="contact" className="section-padding bg-light">
      <div className="container">
        <h2 className="section-title text-center mb-5">تواصل معي</h2>
        <div className="row g-5">
          <div className="col-lg-6" data-aos="fade-right">
            <h3 className="h4 mb-4">لنعمل معاً</h3>
            <p className="lead text-muted mb-4">
              هل لديك مشروع في ذهنك؟ أحب أن أسمع منك.
              أرسل لي رسالة ودعنا نناقش كيف يمكنني مساعدتك في تحقيق أفكارك.
            </p>
            
            <div className="contact-info">
              <div className="contact-item">
                <i className="fas fa-envelope"></i>
                <div>
                  <strong>البريد الإلكتروني</strong>
                  <p>ziaddaseel@email.com</p>
                </div>
              </div>
              
              <div className="contact-item">
                <i className="fas fa-phone"></i>
                <div>
                  <strong>الهاتف</strong>
                  <p>+962 782602130</p>
                </div>
              </div>
              
              <div className="contact-item">
                <i className="fas fa-map-marker-alt"></i>
                <div>
                  <strong>الموقع</strong>
                  <p>عمان، الأردن</p>
                </div>
              </div>
            </div>
          </div>
          
          <div className="col-lg-6" data-aos="fade-left">
            <form className="contact-form" onSubmit={handleSubmit}>
              <div className="row g-3">
                <div className="col-md-6">
                  <input
                    type="text"
                    className="form-control"
                    name="name"
                    placeholder="اسمك الكامل"
                    value={formData.name}
                    onChange={handleChange}
                    required
                  />
                </div>
                
                <div className="col-md-6">
                  <input
                    type="email"
                    className="form-control"
                    name="email"
                    placeholder="بريدك الإلكتروني"
                    value={formData.email}
                    onChange={handleChange}
                    required
                  />
                </div>
                
                <div className="col-12">
                  <input
                    type="text"
                    className="form-control"
                    name="subject"
                    placeholder="الموضوع"
                    value={formData.subject}
                    onChange={handleChange}
                    required
                  />
                </div>
                
                <div className="col-12">
                  <textarea
                    className="form-control"
                    name="message"
                    rows="5"
                    placeholder="رسالتك"
                    value={formData.message}
                    onChange={handleChange}
                    required
                  ></textarea>
                </div>
                
                <div className="col-12">
                  <button 
                    type="submit" 
                    className="btn btn-primary w-100"
                    disabled={isSubmitting}
                  >
                    {isSubmitting ? (
                      <><i className="fas fa-spinner fa-spin me-2"></i>جاري الإرسال...</>
                    ) : (
                      <><i className="fas fa-paper-plane me-2"></i>إرسال الرسالة</>
                    )}
                  </button>
                </div>
              </div>
            </form>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Contact;
